import React from "react";
import { Container, Flex, FlexItem } from "../styles/general/General.styled";
import { SignUpImage } from "../styles/SignInOut.styled";
import Navbar from "./general/Navbar";

const SignInOut = () => {
  return (
    <>
      <Navbar />
      <Container
        p="10rem 4rem"
        mh="100vh"
        bgColor="rgba(224, 247, 250, 0.8)"
        h="60%">
        <Flex bgColor="#f3e5f5" mh="60vh" br="6rem">
          <FlexItem fg="1" w="60%" h="60vh">
            <SignUpImage />
          </FlexItem>
          <Flex fd="column"></Flex>
        </Flex>
      </Container>
    </>
  );
};

export default SignInOut;
